def yam(x):
    #*********** Begin **********#
    if x>0:
        a='0'
    else:
        a='1'
        x=-x
    if x%2==1:
        b='1'
    else:
        b='0'
    x=x//2
    while x!=0:
        if x%2==1:
            b='1'+b
            x//2
        else:
            b='0'+b
            x//2
    while len(b)<7:
        b='0'+b
    y=a+b
    return y
    #*********** End **********#

# 计算补码函数
def bum(x):
    #*********** Begin **********#
    c=yam(x)
    if c[0]=='0':
        um=c
    else:
        i=-1
        while c[i]=='0':
            i -= 1
        for m in range(i-1,-7,-1):
            if c[m]=='0':
                c.replace('0','1')
            else:
                c.replace('1','0')
        um=c
    return um
    #*********** End **********#

