		System.out.println(ppp.getName() + "---" + ppp.getAge());
		ppp.sleep();
		ppp.eat();
		ppp.study();
		ppp.speak();

		/********* end *********/
		System.out.println("----------------");
		// 篮球运动员
		// 通过带参构造函数实例化BasketballPlayer对象bp
		// 输出'name---age'
		// 分别调用sleep()、eat()、study()方法
		/********* begin *********/
		BasketballPlayer bp = new BasketballPlayer(bpName, bpAge);
